const initialState = {
    links: null
}

export default function linkReducer(state = initialState, action){
    switch(action.type){
        case 'GET_LINKS':
            let a = {};
            for (const i of Object.keys(action.payload)){
                a[action.payload[i]["link_id"]] = action.payload[i]["link_address"]
            }
            return {
                ...state, 
                links: a
                
            }
        default: 
            return state 
    }
}
